        <article className="droite">
          <h2>
            SNEAKERBIS, SITE COLLABORATIF <br /> AUTOUR DE LA SNEAKER
          </h2>
          <p className="para">
            Trouvez ici le mod√®le de votre choix <br /> du plus courant au plus
            rare
          </p>
          <div className="btn-page1">
            <div className="btn-acheter">
              <p>ACHETER ICI</p>
